import React from "react";
import ReactDOM from "react-dom";
import Card from "./App";
import Sdata from "./Div";
//simport Sdata from "./Div";
//import "./index.css";

function arr(value){
  return 
   <Card imgsrc={Sdata[value].imgscr}
         title={Sdata[value].title}
         sname={Sdata[value].sname}
         link={Sdata[value].link}
  //yesss={Sdata[value].oo}

/>

}







ReactDOM.render(
  <>
  
      
   {Sdata.map(value)}
   <arr />
  

        
</>,
document.getElementById("root"));
